import React from 'react';
import s from './Proficiency.module.css';

function Proficiency() {
    return (
        <div>
            <span>HTML CSS</span>
            <progress id="file" value="85" max="100"> 32% </progress>
            <span>Java Script</span>
            <progress id="file" value="60" max="100"> 3% </progress>
            <span>Java Script</span>
            <progress id="file" value="60" max="100"> 3% </progress><span>Java Script</span>
            <progress id="file" value="60" max="100"> 3% </progress><span>Java Script</span>
            <progress id="file" value="60" max="100"> 3% </progress>
        </div>
    );
}

export default Proficiency;
